import React from "react";
import GoogleMapReact from 'google-map-react';
import config from './config.json'
import Search from "./Search";
import {Map,InfoWindow} from 'react-amap'

const apikey=config.googlemapkey;
//const datas=require('../../stations.json')
export default function Carte(){
  //parser les donnée 解析
  const [stations,setData]=React.useState([]);
  React.useEffect(()=>{
    fetch("/stations")
    .then((res)=>res.json())
    .then((stations)=>setData(stations.data.stations));
  },[]);
  const defaultProps = {
    center: {
      lat: 48.8607882,
      lng: 2.3492268
    },
    zoom: 13,
  }
  return (
    <div style={{ height: '100vh', width: '100%'}}>
      <Search />
      <Map amapkey="AIzaSyC14MGO1d2DmmDEhHN3Zl2ZmVBI2ouOKtw" zoom={12} plugins={["ToolBar","Scale"]} center={defaultProps.center}>
        <InfoWindow
        position={2.275725,48.865983}
        size={200,100}
        offset={-5,-5}
        ><b>h</b></InfoWindow>
      </Map>
    </div>
  );

};
